  const buttoncolors=
  {
      color:"#800080",
      backgroundColor:"white"
  }
  return (
    <div >
      <Menu widths={3}  size="large">
              <Button size="massive" style={buttoncolors}>TÜM KAMPANYALAR</Button>
              <Button size="massive" style={buttoncolors}>BİRLİKTE AL FIRSATLARI</Button>
              <Button size="massive" style={buttoncolors}>CLUB KAMPANYALARI</Button>
      </Menu>
    </div>
  );
}
